import Button from "@restart/ui/esm/Button";
import React from "react";
import {Navbar, Nav} from "react-bootstrap";
import {Link} from 'react-router-dom';

export default function NaviBar(props)
{
        const active=window.location.pathname.endsWith("favorites")?"block":"none";
    return(
    <>
    <Navbar collapseOnSelect expand="lg"  bg="dark" variant="dark">
        <Navbar.Toggle aria-controls="responsive-navbar-nav"/>
        <Navbar.Collapse id="responsive-navbar-nav">
            <Nav style={{marginLeft:"40%"}}>
                <Nav.Link><Link to="/" style={{color:"white", textDecoration:"none"}}>Home</Link></Nav.Link>
                <Nav.Link><Link to="/favorites" style={{color:"white", textDecoration:"none"}}>Faworites</Link></Nav.Link>
            </Nav>
        </Navbar.Collapse>
    </Navbar>
    <Button variant="primary" style={{display:{}}}>Add custom dish</Button>
    </>
    )
}
